import React from 'react';
import './imageLinkForm.css';

const ImageLinkForm = () => {
	return (
		<div>
			<p className='f3'> 
				{`Well somehow these flowers detect faces,`}
				<br/>
				{` if you think I'm crazy, try it out yourself!`}
			</p>
			<div className='center'> 
				<div className='center pa4 br3 shadow-5'>
					<input className='f4 pa2 w-70 bg-hotpink center' type='text' />
					<button className='w-30 grow f4 link ph3 pv2 dib bg--washedred' >Detect</button>
				</div>
			</div>
		</div>
	);
}

export default ImageLinkForm;
